Action Comics v1 #801, 806-809
Publisher:  DC Comics
Publication Date:  March 5, 2003, August 6, 2003 - November 5, 2003

Writer:  Joe Kelly (#801, 806-809)
Pencillers:  Tom Raney (#801), Pascual Ferry (#806-809), Karl Kerschl (#806), and Joe Kelly (#809)
Inkers:  Walden Wong (#801), Cam Smith (#806-809), Karl Kerschl (#806), and Andy Owens (#809)
Colorists:  Gina Going (#801), Guy Major (#806-809)
Letterer:  Comicraft
Cover Artist:  David Bullock (#801), Pasqual Ferry (#806-809)

Action Comics #801
&quot;Look up in the sky! It's a bird, it's a plane, no...it's NOT Superman! It's a new terror that turns regular people into new metahumans, and it may be the beginning of something even more sinister.&quot;

Action Comics #806
&quot;Supergirls&quot; part 1! Superman is attacked by an unknown assailant and left for dead, and it's up to Girl 13 to protect him. But Natasha Irons, Steel's niece, thinks Girl 13 is the enemy!

Action Comics #807
Mia, another Super-girl, joins the fight along with Natasha Irons and Girl 13. The trio sets out to stop a mysterious assailant who has delivered a near-fatal blow to the Man of Steel. &quot;Supergirls&quot; part 2.

Action Comics #808
Natasha Irons, Girl 13 and the new Supergirl take an injured Superman to his Fortress for a last stand against Byakko! &quot;Supergirls&quot; part 3.

Action Comics #809
Who killed Jack Ryder? While on vacation with Lois, Clark becomes the prime suspect in a murder mystery as, since he was in action as Superman, he's the only one without an alibi!

Thanks goes to DreamGirl for this release.

